function onMouseDown(evt) {
    if (!this.running)
        return;

    var b2Vec2 = Box2D.Common.Math.b2Vec2
        , b2BodyDef = Box2D.Dynamics.b2BodyDef
        , b2Body = Box2D.Dynamics.b2Body
        , b2FixtureDef = Box2D.Dynamics.b2FixtureDef
        , b2Fixture = Box2D.Dynamics.b2Fixture
        , b2CircleShape = Box2D.Collision.Shapes.b2CircleShape
        , b2DistanceJointDef =  Box2D.Dynamics.Joints.b2DistanceJointDef    
    ;

    var a = this.createCircle((evt.x-8.6)/30, (evt.y-8.6)/30, b2Body.b2_dynamicBody);

    for(var body = this.box2dWorld.GetBodyList(); body; body = body.GetNext())
    {
        if (body !== a)
        {
            var x = body.GetPosition().x - a.GetPosition().x,
            y = body.GetPosition().y - a.GetPosition().y;
            if (Math.sqrt(x * x + y * y) < 4 ) {
                var distance_joint = new b2DistanceJointDef();
                distance_joint.bodyA = a;
                distance_joint.bodyB = body;
                //connect the centers - center in local coordinates
                distance_joint.localAnchorA = new b2Vec2(0, 0);
                distance_joint.localAnchorB = new b2Vec2(0, 0);
                distance_joint.length = 3;
                distance_joint.collideConnected = true;
                distance_joint.frequencyHz = 1.3;  // Range 0 to 5
                distance_joint.dampingRatio = .7; // Range 0 to 1
                this.box2dWorld.CreateJoint(distance_joint);    
            }
        }
    }

}

